import React from 'react';

class Examples extends React.Component {
    constructor() {
        super();
    }

    render () {
        let examples = ['1 CIE F1', '2 CIE F2', '3 CIE F3'];
        let optionItems = examples.map((example) =>
                <option key={example.toString()}>{example.toString()}</option>
            );

        return (
         <div>
             <select>
                {optionItems}
             </select>
         </div>
        )
    }
}

export default Examples;
